import React, { useState } from 'react';
import '../styles.css';

const TERMS = [
  {
    key: 'terms1',
    label: '상용 이용약관 동의',
    required: true,
    content: '여러분을 환영합니다. 상용 서비스 및 제품(이하 “서비스”)을 이용해 주셔서 감사합니다. 본 약관은 다양한 상용 서비스의 이용과 관련하여 상용 서비스를 제공하는 상용 주식회사(이하 “상용”)와 이를 이용하는 “회원”과의 관계, 회원의 서비스 이용 절차, 권리·의무 및 책임사항 등을 규정합니다.'
  },
  {
    key: 'terms2',
    label: '개인정보 수집 및 이용 동의',
    required: true,
    content: '개인정보보호법에 따라 회원가입 신청하시는 분께 수집하는 개인정보의 항목, 수집 및 이용목적, 보유 및 이용기간, 동의 거부권 및 동의 거부 시 불이익에 관한 사항을 안내 드립니다.'
  },
  {
    key: 'terms3',
    label: '프로모션 정보 수신 동의',
    required: false,
    content: '상용에서 제공하는 이벤트/혜택 등 다양한 정보를 휴대전화(앱 알림 또는 문자), 이메일로 받아보실 수 있습니다. 일부 서비스(별도 회원 체계로 운영하거나 상용 가입 이후 추가 가입하여 이용하는 서비스 등)의 경우, 별도의 동의 후 서비스 이용이 가능합니다.'
  }
];

function SignupPage() {
  const [checked, setChecked] = useState({ terms1: false, terms2: false, terms3: false });
  const allRequiredChecked = TERMS.filter(t => t.required).every(t => checked[t.key]);
  const allChecked = TERMS.every(t => checked[t.key]);

  const handleAll = e => {
    const value = e.target.checked;
    setChecked({ terms1: value, terms2: value, terms3: value });
  };
  const handleOne = key => e => {
    setChecked(prev => ({ ...prev, [key]: e.target.checked }));
  };

  const [agreed, setAgreed] = useState(false);

  return (
    <div className="page-container auth-page">
      <h2>노바문화센터 이용약관 동의</h2>
      {!agreed ? (
        <div className="terms-box">
          <div className="terms-content">
            <label className="terms-all-label">
              <input type="checkbox" checked={allChecked} onChange={handleAll} />
              <span className="terms-all-text"><b>상용 이용약관, 개인정보 수집 및 이용, 프로모션 정보 수신(선택)에 모두 동의합니다.</b></span>
            </label>
            <div className="terms-list">
              {TERMS.map(term => (
                <div className="terms-item" key={term.key}>
                  <label className="terms-item-label">
                    <input type="checkbox" checked={checked[term.key]} onChange={handleOne(term.key)} />
                    <span className="terms-item-title">{term.label} {term.required ? <span className="terms-required">(필수)</span> : <span className="terms-optional">(선택)</span>}</span>
                  </label>
                  <div className="terms-scrollbox">{term.content}</div>
                </div>
              ))}
            </div>
            <button className="terms-next-btn" onClick={() => setAgreed(true)} disabled={!allRequiredChecked}>확인</button>
          </div>
        </div>
      ) : (
        <form className="auth-form">
          <input type="text" placeholder="아이디" required />
          <input type="password" placeholder="비밀번호" required />
          <input type="password" placeholder="비밀번호 확인" required />
          <input type="email" placeholder="이메일" required />
          <button type="submit">회원가입</button>
        </form>
      )}
    </div>
  );
}

export default SignupPage;
